"use client";

import { Stack, Typography, Grid } from "@mui/material";
import React from "react";
import ItemCart from "./item-cart";

export default function Home() {
  const [total, setTotal] = React.useState(0);
  const [grandTotalPrice, setGrandTotalPrice] = React.useState(0);

  const handleIncremental = (price: number) => {
    setTotal(total + 1);
    setGrandTotalPrice(grandTotalPrice + price);
  };

  const handleDecremental = (price: number) => {
    if (total > 0) {
      setTotal(total - 1);
      setGrandTotalPrice(grandTotalPrice - price);
    }
  };

  const myItems = [
    { itemname: "iPhone 15", price: 32_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iPhone 15 Pro", price: 41_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iPad Pro", price: 32_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iPad Air", price: 22_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iPad", price: 17_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iPad mini", price: 23_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "MacBook Air", price: 37_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "MacBook Pro", price: 73_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "iMac", price: 47_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "Mac mini", price: 20_900, imageUrl: "data:image/jpeg;base64," },
    { itemname: "Mac Studio", price: 74_900, imageUrl: "data:image/jpeg;base64," },
  ];

  return (
    <div>
      <h1>Shopping Cart</h1>
      <Grid container spacing={2}>
        {myItems.map((item) => (
          <ItemCart
            key={item.itemname}
            itemname={item.itemname}
            itemPrice={item.price}
            imageUrl={item.imageUrl}
            handleIncremental={() => handleIncremental(item.price)}
            handleDecremental={() => handleDecremental(item.price)}
          />
        ))}
      </Grid>
      <Stack direction="row" spacing={2} sx={{ mt: 4 }}>
        <Typography variant="h4">Total Items: {total}</Typography>
        <Typography variant="h4">
          Total Price: {grandTotalPrice.toLocaleString()} 
        </Typography>
      </Stack>
    </div>
  );
}